import Navigation from '../component/Navigation';

const Home = () => {
    return (
        <div className='Home'>

            <Navigation/>
            <div className='container'>
              <em> addres mail</em><br/>
              <input type="text" placeholder='entre votre addres mail' /><br/>
              <em> mots de passe</em><br/>
              <input type="text" placeholder='entre votre mots de passe' /><br/><br/>
              <input type="submit"  name='submit' value='envoyer' />


            </div>

        </div>
    );
};

export default Home;
